import './Jumbotron.css';

function Content() {
  return (

    <div class="conten" id="pricing">
        <section className="poto">
        <h2>Skill</h2>
        <hr className="haer"></hr>
            <p>HTML5</p>
            <p>CSS3</p>
            <p>JavaScript</p>
            <p>React JS</p>
        </section> 
    </div>

  );
}

export default Content;
